import React from "react";

const BackGroundVideo = (state) => {
  return (
    <div>
      <video className="videoTag" autoPlay="autoplay" loop="loop" muted>
        <source src ="https://firebasestorage.googleapis.com/v0/b/socialtrip-f5408.appspot.com/o/BackGround%20Video%2FNew%20Zealand%20Fiordland%20National%20Park%20tiny%20waterfall_preview.mp4?alt=media&token=e69478af-32ee-4236-8351-98f3123b4a7b" type="video/mp4" />
      </video>
    </div>
  );
};
export default BackGroundVideo;
